var articlesApp={load:function(){switch(window.location.hash.split("-")[0]){case"#create":console.log("CREATE");break;case"#view":console.log("VIEW");break;case"#edit":console.log("EDIT");break;case"#delete":console.log("DELETE");break;default:!function(){let e=window.location.origin+"/api/articles",t=new XMLHttpRequest;t.open("GET",e),t.setRequestHeader("Content-Type","application/json; charset=UTF-8"),t.send(),t.onload=function(){let e=document.getElementById("app"),n=JSON.parse(t.response).articles,a="",l="";for(let e=0;e<n.length;e++)l=l+`<tr>\n          <td>\n            <a href="#view-${n[e]._id}">${n[e].title}</a>\n          </td>\n          <td>${n[e].description}</td>\n          <td>`+(n[e].published?""+n[e].published.slice(0,19).replace("T"," "):"No Publication Date Set")+"\n          </td>\n        </tr>";a=`<div class="card">\n        <div class="card-header clearfix">\n          <h2 class="h3 float-left">Posts</h2>\n          <div class="float-right">\n            <a href="#create" class="btn btn-primary">New Post</a>\n          </div>\n        </div>\n        <div class="table-responsive">\n          <table class="table table-striped table-hover table-bordered">\n            <thead>\n              <tr>\n                <td>Title</td>\n                <td>Description</td>\n                <td>Date Published</td>\n              </tr>\n            </thead>\n            <tbody>${l}</tbody>\n          </table>\n        </div>\n      </div>`,e.innerHTML=a}}()}}};articlesApp.load();